import React from 'react'
import { useEffect } from 'react'
import { useState } from 'react'
import axios from 'axios'

const Reader = () => {
    const [reader,setReader] = useState([])

    useEffect((reader_id)=>{
        const fetchAll = async ()=>{
            try{
                const res = await axios.get("http://localhost:8800/login/")
                setReader(res.data)
            }catch(err){
                console.log(err)
            }
        }
        fetchAll()
    },[])

    return (
        <div>
            <h1>test</h1>
            <div className="readers">
                {reader.map(reader=>(
                    <div className="reader" key={reader.reader_id}>
                        <p>{reader.reader_email}</p>
                        <p>{reader.reader_password}, {reader.reader_start_date}</p>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default Reader
